import './App.css';
import CircularMeter from 'CircularMeter';

function App() {
  return (
    <div className="App">
      <h1>Conscience Spending Plan</h1>

      <div className='category'>
        <CircularMeter value={60}/>
      </div>
    </div>
  );
}

export default App;
